import React,{Component} from 'react';
import './Separador.css';

class Separador extends Component{
    constructor(props){
        super(props);
        this.state={
            text: props.text,
            h1:{
                heigth: undefined,
                width: undefined
            }
        }
    }

    render(){

        let titulo = <h1>{this.state.text}</h1>

        console.log(titulo.clientHeight);

        return (
            <div className="separador">
                <svg width="100px" heigth="49px" viewBox="0 0 49 100">
                    <path d="M100 25 L0 25" stroke="black"></path>
                </svg>
                {titulo}
                <svg width="100px" heigth="49px" viewBox="0 0 49 100">
                    <path d="M0 25 L100 25" stroke="black"></path>
                </svg>
            </div>
        );
    }

    componentDidMount(){
        console.log("atualizou2");
    }

    componentDidUpdate(){
        console.log("atualizou1");
    }
}

export default Separador;
